const Wrapper = styled.div``;
const ImgContainer = styled.div``;
const Image = styled.img``;
const InfoContainer = styled.div``;
const Title = (<styled className="h1"></styled>)``;
const Desc = styled.p``;
const Price = styled.span``;

const Product = () => {
  return (
    <Container>
      <Navbar />
      <Headline />
      <Wrapper>
        <ImgContainer>
          {/* <Image src="https://www.themanual.com/wp-content/uploads/sites/9/2020/09/hm.jpg?fit=800%2C800&p=1" /> */}
        </ImgContainer>

        <InfoContainer>
          <Title>Hand bag</Title>
          <Desc>
            Lorem ipsum dolor sit amet consectetur adipisicing elit. Numquam sed
            iste illum quasi velit ducimus temporibus totam et vitae porro
            molestiae magnam id accusamus ipsam ratione, quam reiciendis
            voluptatem nihil.
          </Desc>
          <Price>N5,000</Price>
        </InfoContainer>
      </Wrapper>

      <Newsletter />
      <Footer />
    </Container>
  );
};

export default Product;
